import React from "react";
import { Image } from "react-native";

const Checked = () => {
  return (
    <Image
      style={{ height: 40, width: 40 }}
      source={{
        uri:
          "https://png.pngtree.com/element_our/sm/20180515/sm_5afb099d007c6.jpg",
      }}
    />
  );
};

export default Checked;
